import React from "react";
import SideBar from "./menu.js";
import "./menu.css";
import logo from "./logo.png";

const Head = {
  height: "70px"
};
const imgStyle = {
  padding: "15px",
  marginLeft: "35px"
};
const LangStyle = {
  alignItems: "right",
  color: "#56c0d0"
};
function App() {
  return (
    <div id="App" className="App">
      <header id="hd" className=" header indexheader" style={Head}>
        <div>
          <SideBar pageWrapId={"hd"} outerContainerId={"App"} />{" "}
          <img src={logo} alt="logo" style={imgStyle} />
          <a style={LangStyle}>
            Languages <i class="fas fa-caret-down" />
          </a>
        </div>
      </header>
    </div>
  );
}

export default App;
